sys_variable_value.value:
(function execute(inputs, outputs) 
{
    var drugArray = [];
    var statusCode = inputs.statusCode;
    var drugRecords = JSON.parse(inputs.drugRecords);
    
    if (statusCode == 200)
    {
        for (var i = 0; i < drugRecords.length; i++)
        {
            var drugObj = {};
            drugObj.ten_thuoc = drugRecords[i].tenThuoc;
            drugObj.id = drugRecords[i].id;
            drugObj.hoat_chat = drugRecords[i].hoatChat;
            drugObj.phan_loai = drugRecords[i].phanLoai;
            drugObj.so_dang_ky = drugRecords[i].soDangKy;
            drugObj.bao_che = drugRecords[i].hoatChat;
            drugObj.tuoi_tho = drugRecords[i].tuoiTho;
            drugObj.cong_ty_san_xuat = drugRecords[i].congTySx;
            drugObj.nuoc_dang_ky = drugRecords[i].nuocDk;
            drugObj.nhom_thuoc = drugRecords[i].nhomThuoc;
            drugObj.meta = drugRecords[i].meta.fileName;
            drugObj.nong_do = drugRecords[i].nongDo;

            drugArray[i] = drugObj;
        }

    }

    outputs.drugs = drugArray;
    outputs.has_more_value = drugRecords.length > 0;
    
})(inputs, outputs);

